import React from "react";

import Layout from "../../components/Layout";

const Products = ({ data }) => {
  console.log(data);
  return (
    <React.Fragment>
      <Layout>
        <div>Products</div>
      </Layout>
    </React.Fragment>
  );
};

export async function getStaticProps() {
  const res = await fetch("http://localhost:1337/categories");
  const data = await res.json();

  return {
    props: {
      data,
    },
  };
}

export default Products;
